import React from 'react';
import "./About.css";

class About extends React.Component {

    render() {
        return (
            <div className="container-about">
                <h3>About</h3>
                    <ul>
                        <li>design, art</li>
                        <li>business understanding</li>
                        <li>development</li>
                        <li>favorite color black</li>
                        <li>analytical</li>
                        <li>minimalist</li>
                        <li>remote</li>
                        <li>UI/UX</li>
                        <li>self-learner</li>
                        <li>sports</li>
                        <li>curious</li>
                    </ul>
                
            </div>
        );
    }
}
 
export default About;
